  }
  return (
    <div className="wrapper">
      <h1>Application</h1>
      < Dashboard />
      <BrowserRouter>
        <Switch>
          <Route path="/dashboard">
            <Dashboard />
          </Route>
          <Route path="/pad">

          </Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}
export default App;
